        </SwiperSlide>
        <SwiperSlide>
            <img src='https://media.zid.store/bda63855-f7ff-4be7-bd9f-1d497a22336c/4fe3a5ef-d8e5-4b62-8d95-e05bfa4c5e97.png' />
        </SwiperSlide>
      </Swiper>
    </>
    </div>
  )
}

